  "arena_bisaiguize": "1、报名参赛后，每位玩家可获得2000发子弹，捕获鱼后可获得该鱼分值对应的积分，1分鱼=1积分。\n\n 2、比赛发射子弹消耗金币，捕获鱼后可以获得金币。\n\n 3、玩家离场时有剩余子弹，当日比赛时间内都可以随时返回继续参赛。\n\n4、竞技场比赛中，随子弹消耗会出现3次幸运积分任务，完成任务会抽取不同数额的丰厚积分。\n（3次任务积分最高分别为：199，299，499积分）\n\n 5、玩家要发射完2000发子弹才结束一次大奖赛的挑战，积分才能参与排名。\n\n 6、挑战过程中若解锁炮倍率小于等于1000，则必须使用最高炮倍率；解锁1000倍以上，最低可以使用1000倍挑战。\n\n 7、狂暴技能状态下，消耗2倍（3倍、4倍）金币，提高2倍（3倍、4倍） 击杀概率，只消耗一发子弹，击杀获得的积分为正常状态下获得积分的80%（60%、50%） \n\n 8、VIP对比赛积分有加成作用，VIP7加成5%，VIP8加成7%，VIP9加成10%。 \n\n9、竞技场中添加新按钮【手动开关】用于控制【锁定】【狂暴】的下一目标选取，开启状态的【手动开关】将在锁定/狂暴状态时，由您自由选取目标鱼后，再发动攻击，目标鱼捕获后将不会自动选择下一只目标鱼（节省子弹小助手哦）。",
  "arena_paimingguize": "1、积分越高排名越靠前，积分相同时，则先达成积分的排名在前。\n\n2、日擂主：截至23：30时，当天积分最高的玩家为今日擂主。\n\n3、周擂主：选取一周内<color=#FF8B45>3次挑战最高积分之和</color>作为周积分，周积分最高的为周擂主。",
  "arena_jiangliguize": "1、每日比赛，积分首次达到2600分（不计VIP加成），完成竞技场挑战后奖励40钻石，奖励于大厅邮箱领取。\n\n2、每日比赛，积分首次达到2900分（不计VIP加成），完成竞技场挑战后奖励60钻石，奖励于大厅邮箱领取。\n\n3、每日比赛，积分首次达到3200分（不计VIP加成），完成竞技场挑战后奖励5万金币，奖励于大厅邮箱领取。\n\n4、日赛排名前1000的玩家可以领取排名奖励。\n\n5、日赛排名奖励于每日晚上24：00发送，奖励于大厅邮箱领取。\n\n6、周擂主奖励于每周一早上9：00发送，奖励于大厅邮箱领取。\n\n7、VIP玩家在日赛中排名靠前会有额外奖励(大厅邮件领取)：\n      VIP3   第1-3名：15万金币，第4-5名：10万金币；\n      VIP4   第1-3名：30万金币，第4-5名：20万金币；\n      VIP5   第1-3名：50万金币，第4-5名：30万金币；\n      VIP6   第1-5名：100万金币；\n      VIP7   第1名：200万金币，第2-5名：150万金币，第6-10名：100万金币\n      VIP8   第1名：300万金币，第2-5名：200万金币，\n                 第6-10名：150万金币，第11-15名：100万金币\n      VIP9   第1名：400万金币，第2-5名：300万金币，\n                 第6-10名：200万金币，第11-15名：150万金币，第16-20名：100万金币。",
